PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE IF NOT EXISTS users (
  pubkey TEXT UNIQUE NOT NULL PRIMARY KEY,
  registration_date DATE NOT NULL,
  existing_user INTEGER DEFAULT 1
);
CREATE TABLE pagerank_scores (
  pubkey TEXT UNIQUE NOT NULL PRIMARY KEY,
  score REAL NOT NULL,
  rank INTEGER,
  FOREIGN KEY (pubkey) REFERENCES users(pubkey)
);
CREATE TABLE last_posts (
  pubkey TEXT UNIQUE NOT NULL PRIMARY KEY,
  last_post_date INTEGER NOT NULL,
  FOREIGN KEY (pubkey) REFERENCES users(pubkey)
);
CREATE TABLE follows (
  follower TEXT NOT NULL,
  following TEXT NOT NULL,
  PRIMARY KEY (follower, following),
  FOREIGN KEY (follower) REFERENCES users(pubkey),
  FOREIGN KEY (following) REFERENCES users(pubkey)
);
CREATE INDEX idx_registration_date ON users(registration_date);
CREATE INDEX idx_pubkey ON users(pubkey);
CREATE INDEX idx_score ON pagerank_scores(score);
CREATE INDEX idx_rank ON pagerank_scores(rank);
CREATE INDEX idx_last_post_date ON last_posts(last_post_date);
CREATE INDEX idx_last_posts_pubkey ON last_posts(pubkey);
CREATE INDEX idx_pagerank_scores_pubkey ON pagerank_scores(pubkey);
CREATE INDEX idx_follower ON follows(follower);
CREATE INDEX idx_following ON follows(following);
